                    defaultZoom={defaultProps.zoom}
                    bootstrapURLKeys={{ key:"AIzaSyCl7BL_kfB8ZGQ1Uo6TZq9K0t3ajmo53uI"}}
                />
            </div>
        )
    }
}

const mapStateToProps = (state: StateProps): StateProps => {
    console.log(state);
    return state;
};

export default connect(mapStateToProps, {})(Map);
